import './App.css';
import Banner from './components/Banner';
import Footer from './components/Footer';
import Header from './components/Header';
import Homer from './components/Home';
import InsertCustomer from './components/InsertCustomer';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Header/>
      <Router>
        <Switch>
          <Route path="/">
            <Home/>
          </Route>
          <Route path="/customer">
            <InsertCustomer/>
          </Route>
        </Switch>


      </Router>
      <Footer/>
    </div>
  );
}

export default App;
